      serait  la recherche d'un emplacement pour une ou deux ruches, je pense que
      le jardin de ma proprit pourrait offrir le gte  l'un ou l'autre essaim.
      Calme assur, quartier ar, voisinage assez fleuri, bois de Mrode  200m....\r\nDepuis
      3 ans, j'accueille en France plusieurs essaims (jusqu' 7 par an sur 2 ruches
      d'accueil). L'apiculteur local a carte blanche absolue pour la gestion de ses
      ruches et emporte les essaims pour les r-installer dans des ruches plus grandes
      en des endroits souhaits/proposs par les agriculteurs du coin.\r\nJe ne suis
      pas oppos  participer aux frais d'acquisition de la /des ruches.\r\nJe suis
      adhrant depuis plusieurs annes de Pollinis (http://www.pollinis.org) que la
      famille encourage ponctuellement  lutter pour la suppression des nonicotinodes
      et  dvelopper via l'universit de Nantes un moyen naturel et efficace d'radication
      des nids de frelons asiatiques (http://www.pollinis.org/programme-frelon-asiatique/)\r\nBien
      cordialement et  bientt j'espre\r\n(Martine et) Luc Vergeylen\r\n========================"
